import React from 'react';
import SectionContainer from './styled/SectionContainer.styled';
import Paragraph from './styled/Paragraph.styled';
import ArticleGrid from './styled/ArticleGrid.styled';
import ArticleCard from './styled/ArticleCard.styled';
import ThoughtsImg from './styled/ThoughtsImg.styled';
import TopicsContainer from './styled/TopicsContainer.styled';

const Thoughts = () => {
  return (
    <SectionContainer>
      <h4>Thoughts On Code</h4>
      <ArticleGrid>

        <ArticleCard>
          <ThoughtsImg>
            <div>
              <h6>How It All Started</h6>
            </div>
          </ThoughtsImg>
          <h5>November 2022</h5>
          <Paragraph grid>About how I started learning web development.</Paragraph>
          <TopicsContainer>
            <a href={project.homepage} target="_blank" rel="noreferrer">View it live</a>
                | <a href={project.html_url} target="_blank" rel="noreferrer">GitHub Repo</a>
          </TopicsContainer>
        </ArticleCard>

        <ArticleCard>
          <ThoughtsImg>
            <div>
              <h6>Coming soon</h6>
            </div>
          </ThoughtsImg>
          <h5>Coming Soon</h5>
          <Paragraph grid>New article coming soon.</Paragraph>

        </ArticleCard>
      </ArticleGrid>
    </SectionContainer>
  );
};

export default Thoughts;
